import React from 'react'

export default (props) => {
    return (
        <React.Fragment>
            <Menu>
                <Menu.Item header>Our Company</Menu.Item>
                <Menu.Menu position="right">
                    <Menu.Item
                        name='jobs'
                        onClick={this.handleItemClick}
                    />
                    <Menu.Item
                        name='locations'
                        onClick={this.handleItemClick}
                    />
                </Menu.Menu>
            </Menu>

            {props.children}
            <h1>Footer</h1>
        </React.Fragment>
    );
}
